import { useState, useCallback } from "react";
import StudentMode from "../components/StudentMode";
import PortalPopup from "../components/PortalPopup";
import { useNavigate } from "react-router-dom";
import "./DASHBOARDPARENTSETTINGS.css";

const DASHBOARDPARENTSETTINGS = () => {
  const [isStudentModeOpen, setStudentModeOpen] = useState(false);
  const navigate = useNavigate();

  const onGroupButtonClick = useCallback(() => {
    navigate("/22-dashboard-parent-contact-us");
  }, [navigate]);

  const onGroupButton1Click = useCallback(() => {
    navigate("/21-dashboard-parent-progress");
  }, [navigate]);

  const onGroupButton3Click = useCallback(() => {
    navigate("/20-dashboard-home-paretnt");
  }, [navigate]);

  const onGroupButton4Click = useCallback(() => {
    navigate("/22-dashboard-parent-courses");
  }, [navigate]);

  const onFrameButton1Click = useCallback(() => {
    navigate("/15-dashboard-settings-parent-mode");
  }, [navigate]);

  const onGroupContainer8Click = useCallback(() => {
    navigate("/15-dashboard-settings-parent-mode");
  }, [navigate]);

  const openStudentMode = useCallback(() => {
    setStudentModeOpen(true);
  }, []);

  const closeStudentMode = useCallback(() => {
    setStudentModeOpen(false);
  }, []);

  return (
    <>
      <div className="dashboard-parent-settings">
        <div className="group-parent4">
          <div className="group-parent5">
            <div className="rectangle-parent8">
              <div className="group-child10" />
              <div className="group-parent6">
                <button className="group-wrapper5" onClick={onGroupButtonClick}>
                  <div className="contact-us-container">
                    <div className="contact-us3">Contact Us</div>
                    <img className="vector-icon10" alt="" src="/vector.svg" />
                  </div>
                </button>
                <button
                  className="vector-parent4"
                  onClick={onGroupButton1Click}
                >
                  <img className="vector-icon11" alt="" src="/vector1.svg" />
                  <div className="progress4">Progress</div>
                </button>
                <button className="group-parent7">
                  <img className="group-icon3" alt="" src="/group.svg" />
                  <div className="settings5">Settings</div>
                </button>
                <div className="vector-parent5">
                  <img className="vector-icon12" alt="" src="/vector2.svg" />
                  <div className="parent-mode3">Parent Mode</div>
                </div>
              </div>
            </div>
            <button className="home-container" onClick={onGroupButton3Click}>
              <div className="home3">Home</div>
              <img className="vector-icon13" alt="" src="/vector3.svg" />
            </button>
          </div>
          <button className="vector-parent6" onClick={onGroupButton4Click}>
            <img className="vector-icon14" alt="" src="/vector4.svg" />
            <div className="courses4">Courses</div>
            <div className="courses4">Courses</div>
          </button>
        </div>
        <div className="dashboard-parent-settings-child" />
        <div className="div3">
          ______________________________________________________________________________________________________________________________________________
        </div>
        <div className="settings6">Settings</div>
        <div className="dashboard-parent-settings-item" />
        <div className="dashboard-parent-settings-inner" />
        <div className="dashboard-parent-settings-child1" />
        <div className="dashboard-parent-settings-child2" />
        <div className="dashboard-parent-settings-child3" />
        <div className="dashboard-parent-settings-child4" />
        <img
          className="dashboard-parent-settings-child5"
          alt=""
          src="/ellipse-4@2x.png"
        />
        <div className="rectangle-parent9">
          <div className="group-child11" />
          <div className="upload-new">Upload New</div>
        </div>
        <div className="delete-avatar">Delete Avatar</div>
        <div className="gelu1">Gelu</div>
        <div className="filipino">Filipino</div>
        <div className="yahoogmailcom">yahoo@gmail.com</div>
        <div className="ursal1">Ursal</div>
        <div className="student1">Student</div>
        <div className="your-avatar1">Your Avatar</div>
        <div className="firstname1">FirstName</div>
        <div className="lastname1">LastName</div>
        <div className="role1">Role</div>
        <div className="nationality">Nationality</div>
        <div className="email">Email</div>
        <img
          className="emojioneflag-for-philippines-icon"
          alt=""
          src="/emojioneflagforphilippines.svg"
        />
        <img
          className="n-2-icon1"
          alt=""
          src="/386840279-6814446218662428-4749754332335784432-n-2@2x.png"
        />
        <img
          className="microsoftteams-image-1-4"
          alt=""
          src="/microsoftteamsimage-1-5@2x.png"
        />
        <div className="settings7">Settings</div>
        <button className="frame-button">
          <div className="rectangle-wrapper">
            <div className="group-child12" />
          </div>
          <div className="profile2">Profile</div>
        </button>
        <button className="group-parent8" onClick={onFrameButton1Click}>
          <div className="rectangle-frame" onClick={onGroupContainer8Click}>
            <div className="group-child13" />
          </div>
          <div className="password2">Password</div>
        </button>
        <button className="rectangle-parent10" onClick={openStudentMode}>
          <div className="group-child14" />
          <img className="group-child15" alt="" src="/ellipse-5.svg" />
        </button>
      </div>
      {isStudentModeOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeStudentMode}
        >
          <StudentMode onClose={closeStudentMode} />
        </PortalPopup>
      )}
    </>
  );
};

export default DASHBOARDPARENTSETTINGS;
